INSERT INTO `plant_info` VALUES (21,'청경채',29,10,85,55,120,60,3,'청경채는 중국 배추의 일종으로 특유의 아삭아삭한 식감으로 쌈채 뿐만 아니라 볶음 등 다양한 요리에 활용된다. 특히 비타민 C와 식이섬유가 풍부해 피부나 체중관리 등 미용에도 좋은 채소이다. 주로 봄과 가을에 재배된다. 차고 서늘한 기후에서 잘 자란다. 물을 많이 주변 연부병 등이 발생함으로 너무 토양습도가 높지 않게 관리해야 한다.',2),(22,'상추',25,0,85,55,120,60,3,'국화과의 한해살이풀이다. 비교적 서늘한 기후에서 자라는 채소로 성장하는데 상당한 물을 필요로 한다. 철분과 필수 아미노산이 풍부하여 체내 혈액 용량을 증가시키고 피를 맑게 하는 청혈 작용을 하며 저혈압을 예방한다.',2),(23,'토마토',30,10,85,55,120,60,3,'토마토는 가짓과에 속하는 식물이다. 과일과 채소의 두 가지 특성을 갖추고 있으며 비타민과 무기질 공급원으로 아주 우수한 식품이다. 저온에 약하므로 서리를 맞으면 말라죽을 수 있고 여름의 고온에서는 결실이 나빠지고 병해 등이 많이 발생한다. 토마토는 따뜻한 기후에서 잘 자라고, 햇빛을 좋아한다. 빨간색 토마토는 비타민과 영양소가 많아서 골다공증이나 노인성 치매, 암을 예방하는 데 효과가 있다.',3),(24,'몬스테라',27,15,85,55,120,60,3,'몬스테라는 덩굴성 대형관엽식물로 6~8m 까지 자란다. 잎은 어긋나고 성숙한 것은 지름 1m 정도이다. 잎은 진녹색으로 크고 광택이 나며 잎맥 사이에 군데군데 타원형의 구멍이 파여 있어 폭우나 강한 바람에도 견딜 수 있는 구조로 발달 됐다. 흰색의 꽃이 피고 열매도 달린다. 그리고 잎은 절엽으로 하여 꽃꽂이 재료로도 쓰인다. 직사광선에 노출시키면 잎이 타기 쉬우므로 그늘에 둬야 한다.',1),(25,'치자나무',27,15,85,55,120,60,3,'남부지방에서 재배하는 관상식물로 일본 오키나와, 대만, 중국에 분포한다. 6~7월에 흰색 꽃이 피며, 9월에는 열매가 황홍색으로 익는다. 이 열매는 황색 염료로 사용된다. 따뜻한 곳을 좋아하며, 물은 겉흙이 마르지 않을 만큼 주는 것이 좋다. 직사광선이 너무 강한 곳에서는 발육이 안 좋아 반 그늘을 만들어 주어야 한다. ',1),(26,'싱고니움',27,15,85,55,120,60,3,'연두색, 흰색, 빨강, 분홍색등의 잎색과 줄무늬, 점무늬 등 다양한 잎모양을 지닌 대표적인 잎보기식물이다. 실내 암모니아 제거능력이 우수하고 반그늘을 좋아하며 고온다습한 환경에서 잘 자란다. 덩굴성이면서 줄기 마디에서 기근이 나와 다른 물체에 붙어 자란다. 줄기를 자르면 즙액이 나오고 이를 식용하면 위험하다. 응애, 깍지벌레등 병충해를 조심해야한다.',3),(27,'베고니아',18,15,85,55,120,60,3,'베고니아과의 다년초. 열대 · 아열대 원산의 관상용식물로 줄기는 15∼60cm이다. 잎은 대개 길둥글고 어긋나게 나며, 분홍 · 하양 · 빨강 등 여러가지 빛깔의 꽃이 핀다. 햇빛을 많이 받을수록 꽃이 많이 핀다. 추위에 민감해서 찬바람을 맞으면 잎이 축 처지거나 무르기도 한다. 베고니아는 과습 시 쉽게 무르고 곰팡이가 생기므로 물주기에 각별히 신경 써야 한다.',4),(28,'시클라멘',20,10,85,55,120,60,3,'시클라멘은 덩이줄기 구근식물로 꽃은 11월~3월까지 피고, 한줄기 끝에 1개의 꽃이 피며, 보라색, 분홍색, 빨강색, 흰색 등 꽃 색이 다양하다. 통풍이 잘 되는 서늘한 곳을 좋아한다. 관수는 잎과 구근이 닿지 않도록 저면관수 하는 것이 좋다. 하트모양의 독특한 화형을 오랫동안 감상 할 수 있고 겨울철 실내에서 재배가 용이한 장점이 있다. 진딧물, 응애 등 병충해를 조심해야한다.',5),(29,'율마',24,15,85,55,120,60,3,'북아메리카가 원산지인 관엽식물로 크리스마스 트리로 사용되기도 한다. 물과 햇빛 및 통풍관리를 소홀히하면 간단하게 시들어버리기 때문에 육성 난이도가 다소 높은 식물이다. 햇빛을 좋아하지만 저온지대를 선호하고, 습기를 유지해줘야 하지만 통풍 역시 잘 되어야 잘 자라며, 한 번 말라버리면 회복이 불가능한 것으로 알려져 있다. 가볍게 만지거나 살짝 쓰다듬으면 향긋한 레몬향이 나며 가을~겨울 쯔음에 햇빛을 잘드는 차가운 실외에 놓아둘 경우 이파리가 연녹색이 아니라 황금색이 된다.',4),(30,'알로카시아',24,15,85,55,120,60,3,'창끝 모양의 큰 잎과 대단한 옆맥이 볼만한 관엽식물이다. 직사광선을 받으면 잎의 일부분이 불에 탄 것처럼 변하기 때문에 직사광선을 가급적 피해야 한다. 온도가 높고 습기가 많은 곳에서 잘 자라므로 물을 자주 주는것이 좋다. 하지만 과습에 취약하므로 주의해야한다.',5),(31,'바질',25,15,85,55,120,60,3,'열대 아시아 원산지로 하는 식물로 달콤한 향과 약간의 매운맛이 나는 것이 특징이다. 이태리와 프랑스 요리에 많이 사용된다. 두통, 신경과민, 구내염, 강장효과, 건위, 진정, 살균, 불면증에 효능이 있다. 햇빛을 좋아하고 고온다습한 환경에 강하지만 추위에 약하다. 햇빛이 잘 들고 통풍이 좋은 곳에서 키우는 것을 권장한다.',1),(32,'목마가렛',25,15,85,55,120,60,3,'국화과에 속하는 식물로 카나리아 제도에서 왔다. 일반적으로 관상용으로 재배되고 나무쑥갓이라고 부르기도 한다. 나무처럼 줄기가 단단해져서 목 마가렛이라는 이름이 붙었다. 보통 5월부터 1월까지 꽃이 피고 더운 것을 싫어하기 때문에 여름에는 시원한 곳에서 관리해주는 것이 좋다.',3),(33,'스파티필름',25,8,85,55,120,60,3,'열대 아메리카를 원산지로 하는 열대식물로 공기 정화 능력이 매우 뛰어난 식물이다. 빛이 많이 들지 않는 환경에서도 잘 견디고 꽃도 피우기 때문에 쉽게 키울 수 있다. 직사광선은 피하는 것이 좋고 고온 다습하게 관리하는 것을 추천한다. 하지만 뿌리 과습에는 약한 식물이므로 주의해야 한다.',2),(34,'피쉬본',25,15,85,55,120,60,3,'지그재그로 자라는 잎과 곧은 줄기의 모양이 생선 뼈와 비슷하다 해 피쉬본이라는 이름이 붙여졌다. 일반적인 선인장에 비해 몸통의 두께가 얇고 매끄러운 표면을 가지는 것이 특징이다. 직사광선보다는 간접광이 드는 곳에 두는 것이 적절하다. 겨울에는 실내에서 키우는 것을 권장한다. 선인장이므로 과습을 주의해야한다.',1),(35,'콤팩타',20,13,85,55,120,60,3,'줄기와 잎이 위를 향해 자라는 관엽식물로, 실내 인테리어를 위한 관상용 식물인 동시에 포름알데히드, 벤젠 등을 제거하는 공기정화식물로도 적합하다. 간접광을 좋아하는 반양지, 반음지 식물로 그늘에서도 잘 자란다. 직사광선을 오래 받으면 잎이 탈 수 있어 주의해야 한다. 건조한 환경에 약하지만 과습해도 안된다.',3),(36,'스투키',24,13,85,55,120,60,3,'적도와 남아프리카를 원산지로 둔 다육식물로, 굵은 원통형의 잎 여러개가 모여 자란다. 다른 식물들과는 다르게 밤에 공기 중 오염물질을 정화하기 때문에 가정에서는 침실에 두는 것이 적합하다. 밝은 빛에서 가장 잘 자라며 생존력이 강하다. 온도 변화에도 잘 적응하나 추위를 조심하는 것이 좋다. 과습에 민감하여 뿌리가 썩을 수 있다.',1),(37,'애플민트',25,15,85,55,120,60,3,'물풀과에 속하는 여러해살이풀로 사과와 박하가 섞인 듯한 향이 특징이다. 잎으로 허브차를 만들어 마시면 소화불량이나 피로회복에 효과가 있다. 포름알데히드 등을 제거하는 공기정화 기능을 할 수 있다. 내한성과 번식력이 강하며 주로 반그늘 상태에서 잘 자란다. 건조와 과습 중간 상태를 유지할 수 있을 만큼 물을 줘야한다.',3),(38,'히야신스',13,8,85,55,120,60,3,'발칸반도 및 튀르키예를 원산지로 하는 가을에 심는 화초이다. 구근 식물로 총상으로 달린 꽃이 특징이다. 품종에 따라 색상이 다양하다. 화분에서 키우기도 하지만 수경재배도 가능하다. 겨울에도 햇볕이 잘 드는 곳에서 관리하여 화분에 흙이 마르지 않게 해야 한다.',2),(39,'산세베리아',25,10,85,55,120,60,3,'아프리카와 인도를 원산지로 하는 다육식물로 천년란이라고도 한다. 공기정화식물로 인기가 있다. 건조에 강하여 물을 자주 주지 않아도 되지만 잘 키우기 위해서는 햇빛을 잘 받을 수 있는 곳에 두고 저면관수로 관리하는 것이 좋다. 다만 추위에 약하므로 겨울에는 실내에서 키우는 것을 권장한다.',1),(40,'로즈마리',25,15,85,55,120,60,3,'남유럽이 원산지로 온대성에 자라는 다년생의 허브이다. 항균 · 살균 작용이 뛰어나고 보습 효과도 좋다. 피부를 부드럽게 진정시켜주어 화장품 원료로 사용되며, 특유의 신선한 향이 뇌의 기능을 활성화 시켜주어 향신료로 많이 사용되고 있다.  햇빛이 잘 드는 양지 바른 곳에 두고 물은 과습하지 않도록 마른 듯하게 관리해야 한다.',1);
